window.bookSummaryJSON = "<p><b>Number one global bestselling author Sarah J. Maas launches her brand-new CRESCENT CITY series with </b><b><i>House of Earth and Blood</i></b><b>: the story of half-Fae and half-human Bryce Quinlan as she seeks revenge in a contemporary fantasy world of magic, danger, and searing romance.</b></p> <p>Bryce Quinlan had the perfect life-working hard all day and partying all night - until a demon murdered her closest friends, leaving her bereft, wounded, and alone. When the accused is behind bars but the crimes start up again, Bryce finds herself at the heart of the investigation. She'll do whatever it takes to avenge their deaths.</p> <p>Hunt Athalar is a notorious Fallen angel, now enslaved to the Archangels he once attempted to overthrow. His brutal skills and incredible strength have been set to one purpose - to assassinate his boss' enemies, no questions asked. But with a demon wreaking havoc in the city, he's offered an irresistible deal: help Bryce find the murderer, and his freedom will be within reach.</p> <p>As Bryce and Hunt dig deep into Crescent City's underbelly, they discover a dark power that threatens everything and everyone they hold dear, and they find, in each other, a blazing passion - one that could set them both free, if they'd only let it.</p> <p>With unforgettable characters, sizzling romance, and pause-resisting suspense, this richly inventive new fantasy series by number one global<i> </i>bestselling author Sarah J. Maas delves into the heartache of loss, the price of freedom - and the power of love.</p>"; 
